import React, { useEffect, useState } from "react";
import { Customer } from "./section/Customer";

// Styles
import "./app.scss";

// Components
import Header from "./components/Header";
import Footer from "./components/Footer";


function App() {
  return (
    <div className="app">
      <Header />
      <Customer />
      <Footer />
    </div>
  );
}

export default App;
